private boolean allowEditCheckFailed(FieldLabel _fieldLabel)
{
    return checkFailed(strFmt("@ApplicationFoundation:DataEntitiesNoAllowEdit", _fieldLabel));
}

private boolean allowEditCheckFailedForSetOfFields(Set _fieldIds)
{
    var enumerator = _fieldIds.getEnumerator();

    while (enumerator.moveNext())
    {
        warning(strFmt("@ApplicationFoundation:DataEntitiesNoAllowEdit", fieldId2PName(tableNum(PurchPurchaseAgreementLineEntity), enumerator.current())));
    }

    return false;
}

public boolean validateWrite()
{
    return super() && this.InventInventoryDimensionEntityFieldsMapping::validate(this.ItemNumber);
}

private void validateWriteAgreementLineDefault(DataEntityRuntimeContext _entityContext, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    boolean isValid = true;

    AgreementLineDefault agreementLineDefault = _dataSourceCtx.getBuffer();
    AgreementLine agreementLine = _entityContext.getRuntimeContextByName(dataEntityDataSourceStr(PurchPurchaseAgreementLineEntity, AgreementLine)).getBuffer();

    var dataProvider = AgreementLineFieldEditabilityDataProvider::newFromAgreementLine(agreementLine);

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, ProjectCategoryId)) && !dataProvider.canEditProjectFields())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, ProjectCategoryId));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, ProjectActivityNumber)) && !dataProvider.canEditProjectFields())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, ProjectActivityNumber));
    }

    if (!isValid)
    {
        _dataSourceCtx.throwValidateWriteFailed();
    }
}

private void validateWriteAgreementLine(DataEntityRuntimeContext _entityContext, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    boolean isValid = true;

    AgreementLine agreementLine = _dataSourceCtx.getBuffer();
    var dataProvider = AgreementLineFieldEditabilityDataProvider::newFromAgreementLine(agreementLine);

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, ItemNumber)) && !dataProvider.canEditItemId())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, ItemNumber));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, ProcurementProductCategoryName))
        && !dataProvider.canEditCategory()
        && !agreementLine.isCategorySameAsDerived())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, ProcurementProductCategoryName));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, IsCommitmentMaximumEnforced)) && !dataProvider.canEditIsMaxEnforced())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, IsCommitmentMaximumEnforced));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, IsPriceAndDiscountFixed)) && !dataProvider.canEditIsPriceInformationMandatory())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, IsPriceAndDiscountFixed));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, LineDiscountPercentage)) && !dataProvider.canEditDiscount())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, LineDiscountPercentage));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, EffectiveDate)) && !dataProvider.canEditValidityPeriod())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, EffectiveDate));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, ExpirationDate)) && !dataProvider.canEditValidityPeriod())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, ExpirationDate));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, ProjectId)) && !dataProvider.canEditProjectId())
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, ProjectId));
    }

    if (!dataProvider.canEditInventoryDimensions())
    {
        Set inventDimsWithFieldStateSet = this.InventInventoryDimensionEntityFieldsMapping::inventDimFieldIdsWithFieldStateSet();

        if (inventDimsWithFieldStateSet.elements() > 0)
        {
            isValid = this.allowEditCheckFailedForSetOfFields(inventDimsWithFieldStateSet);
        }
    }

    boolean isQuantityBasedLine = agreementLine.isQuantityBased();
    var qtyAgreementLine = agreementLine as AgreementLineQuantityCommitment;
    var qtyDataProvider = dataProvider as AgreementLineQuantityCommitmentFieldEditabilityDataProvider;

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, CommittedQuantity))
        && (!isQuantityBasedLine || (!qtyDataProvider.canEditCommitedQuantity() && !qtyAgreementLine.isCommittedQtySameAsDerived())))
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, CommittedQuantity));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, CommittedCatchWeightQuantity)) && !(isQuantityBasedLine && qtyDataProvider.canEditPdsCWCommitedQuantity()))
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, CommittedCatchWeightQuantity));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, UnitSymbol)) && !(isQuantityBasedLine && qtyDataProvider.canEditProductUnitOfMeasure()))
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, UnitSymbol));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, LineDiscountAmount)) && !(isQuantityBasedLine && dataProvider.canEditDiscount()))
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, LineDiscountAmount));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, Price)) && !(isQuantityBasedLine && dataProvider.canEditPrice()))
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, Price));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, PriceQuantity)) && !(isQuantityBasedLine && dataProvider.canEditPrice()))
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, PriceQuantity));
    }

    if (this.isFieldModified(fieldNum(PurchPurchaseAgreementLineEntity, CommittedAmount)) && isQuantityBasedLine)
    {
        isValid = this.allowEditCheckFailed(fieldPName(PurchPurchaseAgreementLineEntity, CommittedAmount));
    }

    // We need to validate certain agreement line default fields here because if no fields are specified from <c>AgreementLineDefault</c>
    // then the record will never be inserted by the data entity framework and thus will never be validated.
    // But in certain cases (e.g. when ProjectId is specified on theheader) the <c>AgreementLineDefault</c>  record must exists.
    if (!this.ProjectCategoryId && agreementLine.ProjectProjId)
    {
        isValid = checkFailed(strFmt("@SYS26332", fieldPName(PurchPurchaseAgreementLineEntity, ProjectCategoryId)));
    }

    if (!isValid)
    {
        _dataSourceCtx.throwValidateWriteFailed();
    }
}

private CommitmentType getCommitmentTypeForInsert()
{
    if (this.isFieldSet(fieldNum(PurchPurchaseAgreementLineEntity, CommitmentType)))
    {
        return this.CommitmentType;
    }

    return this.findPurchAgreementHeader().DefaultAgreementLineType;
}

private CommitmentType getCommitmentType(DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    switch (_dataSourceCtx.getDatabaseOperation())
    {
        case DataEntityDatabaseOperation::Insert:
            return this.getCommitmentTypeForInsert();

        case DataEntityDatabaseOperation::Update:
            return this.CommitmentType;

        default:
            throw error(Error::wrongUseOfFunction(funcName()));
    }
}

private PurchAgreementHeader findPurchAgreementHeader()
{
    return PurchAgreementHeader::findAgreementId(this.PurchaseAgreementId);
}

private AgreementHeaderDefault findAgreementHeaderDefault()
{
    return AgreementHeaderDefault::findAgreementHeader(PurchAgreementHeader::findAgreementId(this.PurchaseAgreementId).RecId);
}

private EcoResCategoryHierarchyRole procurementHierarchyRole()
{
    EcoResCategoryHierarchyRole hierarchyRole;

    select firstonly CategoryHierarchy from hierarchyRole
                where hierarchyRole.NamedCategoryHierarchyRole == EcoResCategoryNamedHierarchyRole::Procurement;

    return hierarchyRole;
}

